              </S.Description>
              <S.Price>R$3,000/mês</S.Price>
            </S.Info>
          </S.Room>
        </S.Rooms>
        <S.Map>Mapa</S.Map>
      </S.RoommatesMapContent>
    </S.RoommatesMapWrapper>
  );
};
